To address the issue described in incident 0, we need to update the `@GeneratedValue` annotation to specify the sequence name explicitly. This is because Hibernate 6.0 creates a sequence per entity hierarchy instead of a single sequence `hibernate_sequence`. 

We will update the `@GeneratedValue` annotation to use `@GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "order_seq")` and add a `@SequenceGenerator` annotation to define the sequence name.

